import React, { useState } from 'react'

const InititateWorkoutPage = () => {
    const [time, setTime] = useState(0)
    const [timeOn, setTimeOn] = useState(false)



  return (
    <div>
        {time}
        <button onClick={() => {
            setTimeOn(true)
        }}>Start</button>
        <button onClick={() => {
            setTimeOn(false)
        }}>Stop</button>
        <button>Reset</button>
    </div>
  )
}

export default InititateWorkoutPage
